import React, { Component } from 'react'
import { FaCheck } from 'react-icons/fa';
import Btn from '../../../container/Btn'

class Items extends Component {
    constructor() {
        super();
        this.item = {
            name: ["KenganC","LunaMa","Areluwa"," GangTm"],
            profile: [Avatar1,Avatar2,Avatar3,Avatar4],
        }
    }
    render() {
        return (
            <div className='item d-flex gap-2 justify-content-between align-items-center'>
                <div className='img position-relative'>
                    <img src={this.props.img} alt="strem-item" className='rounde-5' />
                </div>
                <div className='name d-flex gap-2 align-items-center'>
                    <span className='rounded-5 p-1 bg-pink d-flex justify-content-center align-items-center'>
                        <FaCheck className='text-white fs-sm1'/>
                    </span>
                    <span className='text-pink'>{this.props.name}</span>
                </div>
                <Btn name="follow" link="#"/>
            </div>
        )
    }
}

export default Items;
